import PropTypes from 'prop-types';

function Secao(props) {

    function geraItem(item){
        return(
            <li>{item.descricao}</li>
        );
    }

    function obterItemSecao4(){
        if(props.secao4.length === 0){
            return null;
        }
        let items = [];
        props.secao4.map(item => {
            items.push(geraItem(item));
        });
        items.push(<li>Nova Secao | Novo Documento</li>)
        items.push(obterSecao4());
        return (items);
    }

    function obterSecao4(){
        return (
            <ul>
                {obterItemSecao4()}
                <li>Nova Secao</li>        
            </ul>
        );
    }

    function obterItemSecao3(){
        if(props.secao3.length === 0){
            return null;
        }
        let items = [];
        props.secao3.map(item => {
            items.push(geraItem(item));
        });
        items.push(<li>Nova Secao | Novo Documento</li>)
        items.push(obterSecao4());
        return (items);
    }

    function obterSecao3(){
        return (
            <ul>
                {obterItemSecao3()}
                <li>Nova Secao</li>        
            </ul>
        );
    }

    function obterItemSecao2(){
        if(props.secao2.length === 0){
            return null;
        }
        let items = [];
        props.secao2.map(item => {
            items.push(geraItem(item));
        });
        items.push(<li>Nova Secao | Novo Documento</li>)
        items.push(obterSecao3());
        return (items);
    }

    function obterSecao2(){
        return (
            <ul>
                {obterItemSecao2()}
                <li>Nova Secao</li>        
            </ul>
        );
    }

    function obterItemSecao1(){
        if(props.secao1.length === 0){
            return null;
        }
        let items = [];
        props.secao1.map(item => {
            items.push(geraItem(item));
        });
        items.push(<li>Nova Secao | Novo Documento</li>)
        items.push(obterSecao2());
        return (items);
    }

    return ( 
        <ul>
            {obterItemSecao1()}
            <li>Nova Secao</li>        
        </ul>
    );
}

Secao.propTypes = {
    secao1: PropTypes.array.isRequired,
    secao2: PropTypes.array.isRequired,
    secao3: PropTypes.array.isRequired,
    secao4: PropTypes.array.isRequired
}

export default Secao;
